data.text:
@ShinKeru A ver, no se como lees.
No estoy diciendo que te esten obligando.
Es que si quieres eso tienes que pagar.

@babygorila_ @ddd_flame Se le cae el pelo a los empleados.
Dar comida no es tan facil.
Y pista: los pobres tambien son personas eh, no son cubos de basura donde echar lo que tu ya no quieres.

@zthes4 Yo la dejo pero ella lo busca.
Y no le gustara tanto el angulo que yo criticaba cuando lo ha cambiado por el angulo que yo dije.
Me llamais pesada pero sois vosotros los que no me dejais en paz por chuparle el culo a ella.

@Mimi_XXL El buffet libre no te lo puedes llevar, esa norma es para que no pidas pizzas de mas. Si no es buffet, si te lo puedes llevar si lo pides. 
Y la comida ya empezads a comer no se le puede dar a los pobres, por seguridad alimentaria. 
Porque ya esta contaminada.

@anxious_nakama @su__3006 Malinterpretar el que?
Si en todo momento lo he explicado.
Otra cosa es que no leais.

@Jesskiu_ Porque se lo que es tener tetas y se que no las puedes ocultar, si estan ahi estan ahi lleves o no lleves escote.
Por eso, no hablo sobre nada de sus tetas de si ensena o no.
Pero por alguna razon, solo pensais en eso diciendo cosas que no he dicho porque "es que soy fan de abby"

@lalylaliaa Total eh 
Y es que no lo entiendo, porque el tema es una tremenda gilipollez jajajaja
Porque yo no veo nada de streaming, lo poco que veo es los videos de tiktok

@ShinKeru Hablado como dos personas normales.
En plan "lo he intentado, pero no se como poner la camara, pero estoy en proceso de mirar algun tripode o algo para cambiarlo, si sabes de algo me dices" 
Pero no, fue a ser borde y a generar odio.

@kiminonari Total, si me hubiese metido de ella, me calleria la boca porque me lo mereceria
Pero es que no ha sido asi, y asi solo hace dejarme como una loca y borde.
Y claro, asi sus fans no paran de insultarme jaja

@Dark_hanyo Sigue leyendo anda, 
Porque explico que despues de ponerme verde y estar con gente insltandome varios dias al final yo tenia razon, y no ha dicho nada de "gente os habeis pasado con esta muchacha"
Salud mental pero solo para ella.

@Dark_hanyo Cansa un huevo que me vengais asi cuando ni siquiera habeis leido nada.
Osea informaos antes de hablar como minimo no?
Es que ya me dejais sin ganas de na, es como hablar con una pared con fotos de la muchacha.

@Dark_hanyo No.
Repito, no me he metido con ella, porque yo he generalizado. Es decir, no he dado mi opinion sobre ella, he dado mi opinion de la gente del streaming en general.
Que no sepas diferenciarlo no es mi culpa.

@AriElPonsa Que comentario machista?
Ya vas a empezar a decir que lo he dicho por las tetas cuando no paro de explicar por que cojones lo digo?
Por que solo podeis pensar en tetas?

@xstarkiex @NOAHC0R3 @Nanellewang Tu lo has dicho, es una red social y cada uno expone lo que quiere. Pero sabes la diferencia?
Que a pesar de ser una red social, estas tratando con personas, que se merecen el mismo respeto que te gustaria recibir.
Que solo nos preocupa la salud mental propia, no la de los demas
